import css from 'styled-jsx/css';

export default css`.footer-wrap {
  background-color: #262626;
  height: 601px;
  box-sizing: border-box;
  padding-top: 113px;
}
.footer-wrap .company-info ul {
  width: 170px;
  height: 267px;
  display: inline-block;
  vertical-align: top;
}
.footer-wrap .company-info ul li {
  font-size: 16px;
  font-family: Source Han Sans CN;
  font-weight: 400;
  color: #fefefe;
  line-height: 30px;
}
.footer-wrap .company-info ul li img {
  width: 143px;
  height: 143px;
}
.footer-wrap .company-info ui.info {
  width: 370px;
}
`
